import React from "react";
import "../../bulma/css/bulma.min.css";
import "../../App.css";

let FilterBrands = (props) => {
  function onFilterValueChanged(event) {
    console.log(event.target.value);
    props.filterValueSelected(event.target.value);
  }

  return (
    <div>
      <div className="FilterCSS">
        <select name="isAvailable" onChange={onFilterValueChanged}>
          <option value="All">All</option>
          <option value="FilterBySectorPrimary">
            Filter by Sector: Primary
          </option>
          <option value="FilterBySectorSecondary">
            Filter by Sector: Secondary
          </option>
          <option value="FilterBySectorTertiary">
            Filter by Sector: Tertiary
          </option>
        </select>
      </div>
    </div>
  );
};

export default FilterBrands;
